import currencyService from "../services/CurrencyService";

export default {
  state: {
    cryptos: [],
  },
  getters: {},
  mutations: {
    ADD_CRYPTO(state, payload) {
      state.cryptos = payload;
    },
  },
  actions: {
    async getCryptoCurrenciesExchange() {
      const { data } = await currencyService.getCurrency();
      if (data.status === 200) {
        //   commit(
        //     "ADD_CRYPTO",
        //     data.result.sort((a, b) => {
        //       return a.id - b.id;
        //     }),
        //   );
        data.result
          .sort((a, b) => {
            return a.id - b.id;
          })
          .filter((e) => {
            return e.name_currency !== localStorage.getItem("giveCurrency").replace(/['"«»]/g, "");
          });
        return data.result;
      }
    },
  },
};
